import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';
import { FaBars } from 'react-icons/fa';

const Navbar = () => {
  return (
    <motion.nav 
      initial={{ y: -100 }}
      animate={{ y: 0 }}
      transition={{ duration: 0.5 }}
      className="bg-gray-100 p-4 flex justify-between items-center fixed w-full z-10"
    >
      <Link to="/" className="text-2xl font-light text-gray-800">JR Auto Detailing</Link>
      <div className="flex items-center space-x-6">
        <NavLink to="/about">About</NavLink>
        <NavLink to="/portfolio">Portfolio</NavLink>
        <NavLink to="/services">Services</NavLink>
        <button className="text-sm uppercase tracking-wide text-gray-800"><FaBars /></button>
      </div>
    </motion.nav>
  );
};

const NavLink = ({ to, children }) => (
  <Link 
    to={to} 
    className="text-sm uppercase tracking-wide text-gray-800 hover:text-gray-600 transition-colors duration-300"
  >
    {children}
  </Link>
);

export default Navbar;
